import React, { useState } from "react";
import '../styles/assessment.css';
const Ques = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    scores: {},
  });
  const [result, setResult] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;

    if (name.startsWith("q")) {
      setFormData((prevData) => ({
        ...prevData,
        scores: {
          ...prevData.scores,
          [name]: parseInt(value, 10),
        },
      }));
    } else {
      setFormData((prevData) => ({
        ...prevData,
        [name]: value,
      }));
    }
  };

  const calculateSeverity = (totalScore, userName) => {
    let severity = "";
    let message = "";
    let emoji = "";

    if (totalScore === 0) {
      severity = "No depression";
      message = `Great, ${userName}! You have no signs of depression. Keep maintaining your mental well-being!`;
      emoji = "ðŸ˜Š";
    } else if (totalScore >= 1 && totalScore <= 4) {
      severity = "Minimal depression";
      message = `Hi ${userName}, this might be due to stress. No need to worryâ€”you can take steps to manage it yourself.`;
      emoji = "ðŸŒŸ";
    } else if (totalScore >= 5 && totalScore <= 9) {
      severity = "Mild depression";
      message = `${userName}, consider stress-relieving activities or talking to a trusted person.`;
      emoji = "ðŸ’¡";
    } else if (totalScore >= 10 && totalScore <= 14) {
      severity = "Moderate depression";
      message = `It may be helpful to consult a mental health professional for guidance, ${userName}.`;
      emoji = "ðŸ§ ";
    } else if (totalScore >= 15 && totalScore <= 19) {
      severity = "Moderately severe depression";
      message = `${userName}, meeting with a psychiatrist or therapist is strongly recommended.`;
      emoji = "ðŸ©º";
    } else if (totalScore >= 20) {
      severity = "Severe depression";
      message = `${userName}, please seek immediate help from a mental health professional.`;
      emoji = "ðŸš¨";
    }

    return { severity, message, emoji };
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const userName = formData.name;
    const userEmail = formData.email;

    if (!userName || !userEmail) {
      alert("Name and email are required to submit the test.");
      return;
    }

    const totalScore = Object.values(formData.scores).reduce((acc, curr) => acc + curr, 0);
    const { severity, message, emoji } = calculateSeverity(totalScore, userName);

    setResult({
      totalScore,
      severity,
      message,
      emoji,
    });

    const testData = {
      name: userName,
      email: userEmail,
      score: totalScore,
      severity,
    };

    try {
      const response = await fetch("http://localhost:5001/api/saveTestResult", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(testData),
      });

      if (!response.ok) {
        console.error("Failed to save test results.");
      } else {
        console.log("Test results saved successfully.");
      }
    } catch (error) {
      console.error("Error saving test results:", error);
    }
  };

  return (
    <div className="container">
      <header>
        <h1>Self Assessment Test</h1>
      </header>
      <form id="phq9-form" onSubmit={handleSubmit}>
        <div className="user-info">
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" value={formData.name} onChange={handleInputChange} required />
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" value={formData.email} onChange={handleInputChange} required />
        </div>

        <p>
          Over the last 2 weeks, how often have you been bothered by any of the
          following problems?
        </p>

        {[...Array(9)].map((_, i) => (
          <div className="question" key={i + 1}>
            <p>{i + 1}. Sample question text</p>
            {Array.from({ length: 4 }, (_, j) => (
              <label key={j}>
                <input
                  type="radio"
                  name={`q${i + 1}`}
                  value={j}
                  onChange={handleInputChange}
                  required
                />
                {j === 0 && "Not at all"}
                {j === 1 && "Several days"}
                {j === 2 && "More than half the days"}
                {j === 3 && "Nearly every day"}
              </label>
            ))}
          </div>
        ))}

        <button type="submit" className="submit-btn">Submit</button>
      </form>

      {result && (
        <div id="result">
          <h2>Your Results</h2>
          <p>Your total score is: {result.totalScore}</p>
          <p>Depression Severity: {result.severity}</p>
          <p>
            {result.emoji} {result.message}
          </p>
        </div>
      )}
      <footer>
        <p>&copy; 2024 PHQ-9 Assessment Tool</p>
      </footer>
    </div>
  );
};

export default Ques;
